import React from 'react'


class MovieList extends React.Component {
    render(){
        const {Moviedata} = this.props;
        return (
            <React.Fragment>
                {this.renderMovies(Moviedata)}
            </React.Fragment>
        );
        
    }
}

export default MovieList;
